var title_f3_50_3876="How pregnancy happens PI";
var content_f3_50_3876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F73238&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F73238&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 557px\">",
"   <div class=\"ttl\">",
"    How pregnancy happens",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 511px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To get pregnant (in the traditional way), a woman must have sex with a man around the time she ovulates (releases an egg from the ovary). Then the following steps must occur:",
"    <br>",
"     <ol>",
"      <li>",
"       The man's sperm must swim up the vagina, into the uterus, and up the tubes that connect the ovaries to the uterus (called the fallopian tubes).",
"      </li>",
"      <li>",
"       When the sperm reach the woman's egg, at least one sperm must eat through the outer casing of the egg and make it inside. This is called fertilization.",
"      </li>",
"      <li>",
"       The newly fertilized egg must travel down to the uterus.",
"      </li>",
"      <li>",
"       The egg must secure itself to the wall of the uterus. This is called implantation.",
"      </li>",
"     </ol>",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
